import React from "react";
import {NavLink} from "react-router-dom";
import '../Elements/Button/button.scss'

// import {Link} from 'react-scroll'

const Menu = () => {

  return (
    <div className>
    <nav className="menu-top">
      <ul className="menu-content">
        <li><NavLink exact to="/"  className="btn">Start</NavLink></li>
        <li className="btn">O co chodzi</li>
        <li className="btn">O nas</li>
        <li className="btn">Fundacje i organizacje</li>
        <li className="btn">Kontakt</li>
      </ul>
    </nav>
    </div>
  )
}

export default Menu;
